import { BrowserRouter, Link, Route, Routes } from "react-router-dom"
import { ProductList } from "./components/ProductList"
import { Cart } from './components/Cart';
import { ProductProvaider } from "./Context"
import { Add } from "./Add";

export const RoteConfig = () => {
    return <BrowserRouter>
        <ProductProvaider>
            <div >
                <nav className="navbar navbar-expand navbar-light bg-light">
                    <div className="container-fluid">
                        <div className="d-flex flex-grow-1">
                            <ul className="navbar-nav me-auto">
                                <li className="nav-item">

                                    <Link to="/" className="nav-item">Home</Link>
                                </li>

                                 <li className="nav-item">

                                    <Link to="/basket" className="nav-item">Cart</Link >
                                </li>
                                 <li className="nav-item">

                                    <Link to="/Add" className="nav-item">Add</Link>
                                </li>
                            </ul>
                        </div>
                        <div className="d-flex">
                            <NavLink className="nav-link" to="/search">
                                 <i className="fas fa-search"></i> {/* Make sure Font Awesome is included */}
                            </NavLink>
                        </div>
                     </div>
                     
                 </nav>
                 </div>


                        <Routes>
                            <Route path="Add" element={<Add />}></Route>
                            <Route path="" element={<ProductList />} />
                            <Route path="basket" element={<Cart />} />
                        </Routes>
                    </ProductProvaider>
                </BrowserRouter>
}




